import styles from "./styles.scss";

export default function Logo() {
  return (
    <div className={styles.Logo}>
      <img className={styles.logo_web} src="/svg/logo-web.svg" />
      <img className={styles.logo_mobile} src="/svg/logo-web.svg" />
    </div>
  );
}
